//==============================================================================
void TalComponent::changeListenerCallback (void* source)
{
    // this is the filter telling us that it's changed, so we'll update our
    // display of the time, midi message, etc.
    updateParametersFromFilter();
}

void TalComponent::sliderValueChanged (Slider* caller)
{
    TalCore* const filter = getFilter();
	if (caller == cutoffKnob) filter->setParameterNotifyingHost(CUTOFF, (float)cutoffKnob->getValue());
	if (caller == resonanceKnob) filter->setParameterNotifyingHost(RESONANCE, (float)resonanceKnob->getValue());
	if (caller == lfoRateKnob) filter->setParameterNotifyingHost(LFORATE, (float)lfoRateKnob->getValue());
	if (caller == lfoIntensityKnob) filter->setParameterNotifyingHost(LFOINTENSITY, (float)lfoIntensityKnob->getValue());
	if (caller == volumeKnob) filter->setParameterNotifyingHost(VOLUME, (float)volumeKnob->getValue());
	if (caller == inputDriveKnob) filter->setParameterNotifyingHost(INPUTDRIVE, (float)inputDriveKnob->getValue());
	if (caller == envelopeIntesityKnob) filter->setParameterNotifyingHost(ENVELOPEINTENSITY, (float)envelopeIntesityKnob->getValue());
	if (caller == envelopeSpeedKnob) filter->setParameterNotifyingHost(ENVELOPESPEED, (float)envelopeSpeedKnob->getValue());
	if (caller == lfoWidthKnob) filter->setParameterNotifyingHost(LFOWIDTH, (float)lfoWidthKnob->getValue());
}

void TalComponent::comboBoxChanged (ComboBox* caller)
{
    TalCore* const filter = getFilter();
	if (caller == filterTypeComboBox) filter->setParameterNotifyingHost(FILTERTYPE, (int)filterTypeComboBox->getSelectedId());
	if (caller == lfoWaveformComboBox) filter->setParameterNotifyingHost(LFOWAVEFORM, (int)lfoWaveformComboBox->getSelectedId());
	if (caller == lfoSyncComboBox) filter->setParameterNotifyingHost(LFOSYNC, (int)lfoSyncComboBox->getSelectedId());
}

void TalComponent::buttonClicked (Button* caller)
{
    TalCore* const filter = getFilter();
	if (caller == midiLearnButton) 
	{
		float midiLearn = 0.0f;
		if (caller->getToggleState() == true) midiLearn = 1.0f;
		filter->setParameterNotifyingHost(MIDILEARN, midiLearn);
	}
}

//==============================================================================
void TalComponent::updateParametersFromFilter()
{
    TalCore* const filter = getFilter();

    // we use this lock to make sure the processBlock() method isn't writing to the
    // lastMidiMessage variable while we're trying to read it, but be extra-careful to
    // only hold the lock for a minimum amount of time..
    filter->getCallbackLock().enter();

    // take a local copy of the info we need while we've got the lock..
	float cutoff = filter->getParameter(CUTOFF);
	float resonance = filter->getParameter(RESONANCE);
	float lfoRate = filter->getParameter(LFORATE);
	float lfoIntensity = filter->getParameter(LFOINTENSITY);
	float volume = filter->getParameter(VOLUME);
	float inputDrive = filter->getParameter(INPUTDRIVE);

	float filtertype = filter->getParameter(FILTERTYPE);
	float lfoWaveform = filter->getParameter(LFOWAVEFORM);
	float lfoSync = filter->getParameter(LFOSYNC);

	float envelopeIntesity = filter->getParameter(ENVELOPEINTENSITY);
	float envelopeSpeed = filter->getParameter(ENVELOPESPEED);
	float lfoWidth = filter->getParameter(LFOWIDTH);

	float midiLearn = filter->getParameter(MIDILEARN);

    // ..release the lock ASAP
    filter->getCallbackLock().exit();

	cutoffKnob->setValue(cutoff); 
	resonanceKnob->setValue(resonance); 
	lfoRateKnob->setValue(lfoRate); 
	lfoIntensityKnob->setValue(lfoIntensity);
	volumeKnob->setValue(volume);
	inputDriveKnob->setValue(inputDrive);

	envelopeIntesityKnob->setValue(envelopeIntesity);
	envelopeSpeedKnob->setValue(envelopeSpeed);
	lfoWidthKnob->setValue(lfoWidth);

	filterTypeComboBox->setSelectedId(filtertype); 
	lfoWaveformComboBox->setSelectedId(lfoWaveform); 
	lfoSyncComboBox->setSelectedId(lfoSync); 

	if (midiLearn > 0.0f)
	{
		midiLearnButton->setToggleState(true, false);
	}
	else
	{
		midiLearnButton->setToggleState(false, false);
	}
}

